import productList from "./products";
export default class App extends Component {
  state = {
    products: [],
  };

  componentDidMount() {
    async function data() {
      await this.setState({ products: productList });
      console.log(this.state.products);
    }
    data.bind(this);
  }

  render() {
    return <div></div>;
  }
}
